const RegisterPage =()=>{
  let {registerUser} =useContext(AuthContext)
  return (
    <div className='formCenter'>
      <form onSubmit={registerUser} className='formFields'>
        <div className='formField'>
          <label className='formFieldLabel' htmlFor="name">
            Username
